import React from "react";
import { Link } from "react-router-dom";
import NavItems3 from "../NavItems3";
import NavItems2 from "../NavItems2";
import Toggle from "../Toggle";
import Ouinon2 from "../Ouinon2";
import Ouinon from "../Ouinon";
import Frame11732 from "../Frame11732";
import "./LeadTime1.css";

function LeadTime1(props) {
  const {
    x1200PxLogo_Icam__20081,
    pleaseAnswerTheFollowingQuestions,
    inputType1,
    inputPlaceholder1,
    inputType2,
    inputPlaceholder2,
    inputType3,
    inputPlaceholder3,
    inputType4,
    inputPlaceholder4,
    inputType5,
    inputPlaceholder5,
    inputType6,
    inputPlaceholder6,
    inputType7,
    inputPlaceholder7,
    inputType8,
    inputPlaceholder8,
    navItems3Props,
    toggle1Props,
    ouinon21Props,
    ouinon22Props,
    toggle2Props,
    ouinon23Props,
    ouinon24Props,
    toggle3Props,
    ouinon1Props,
    ouinon2Props,
    ouinon3Props,
    ouinon4Props,
    toggle4Props,
  } = props;

  return (
    <div className="container-center-horizontal">
      <div className="lead-time-1-1 screen">
        <div className="overlap-group-30">
          <Link to="/home">
            <img
              className="x1200px-logo_icam_-_2008-1-30"
              src={x1200PxLogo_Icam__20081}
              alt="1200px-Logo_ICAM_-_2008 1"
            />
          </Link>
          <div className="nav-items-container-10">
            <NavItems3
              className={navItems3Props.className}
              frame1172Props={navItems3Props.frame1172Props}
              frame1162Props={navItems3Props.frame1162Props}
              frame1132Props={navItems3Props.frame1132Props}
            />
            <NavItems2 />
          </div>
        </div>
        <p className="please-answer-the-following-questions-9 valign-text-middle bevan-normal-white-20px">
          {pleaseAnswerTheFollowingQuestions}
        </p>
        <div className="dialogue-social-1">
          <div className="dialogue-social-1-1">
            <div className="group-107">
              <div className="flex-col-51">
                <Toggle className={toggle1Props.className} buttonSecondaryProps={toggle1Props.buttonSecondaryProps} />
                <textarea
                  className="do-you-have-a-delay-rate subtitel"
                  name="doyouhaveadelayrate"
                  placeholder={inputPlaceholder1}
                  type={inputType1}
                ></textarea>
                <Ouinon2 frame42Props={ouinon21Props.frame42Props} frame43Props={ouinon21Props.frame43Props} />
                <input
                  className="if-so-how-much-is-it subtitel"
                  name="ifsohowmuchisit"
                  placeholder={inputPlaceholder2}
                  type={inputType2}
                />
                <Ouinon2
                  className={ouinon22Props.className}
                  frame42Props={ouinon22Props.frame42Props}
                  frame43Props={ouinon22Props.frame43Props}
                />
              </div>
            </div>
          </div>
          <div className="dialogue-social-2">
            <Toggle className={toggle2Props.className} buttonSecondaryProps={toggle2Props.buttonSecondaryProps} />
            <input
              className="can-your-suppliers-b subtitel"
              name="canyoursuppliersbeflexibletoyourdemand"
              placeholder={inputPlaceholder3}
              type={inputType3}
            />
            <Ouinon2
              className={ouinon23Props.className}
              frame42Props={ouinon23Props.frame42Props}
              frame43Props={ouinon23Props.frame43Props}
            />
            <input
              className="if-not-can-you-chang subtitel"
              name="ifnotcanyouchangesuppliersquicklyifthesupplierdoesnotmeetyourexpectations"
              placeholder={inputPlaceholder4}
              type={inputType4}
            />
            <Ouinon2
              className={ouinon24Props.className}
              frame42Props={ouinon24Props.frame42Props}
              frame43Props={ouinon24Props.frame43Props}
            />
          </div>
          <div className="dialogue-social-3">
            <Toggle className={toggle3Props.className} buttonSecondaryProps={toggle3Props.buttonSecondaryProps} />
            <textarea
              className="if-no-can-you-change subtitel"
              name="ifnocanyouchangesuppliersquicklyifthesupplierdoesnotmeetyourexpectations"
              placeholder={inputPlaceholder5}
              type={inputType5}
            ></textarea>
            <Ouinon place={ouinon1Props.place} yes={ouinon1Props.yes} className={ouinon1Props.className} />
            <input
              className="do-you-have-calculat subtitel"
              name="doyouhavecalculationmethodsformakingpurchaseforecasts"
              placeholder={inputPlaceholder6}
              type={inputType6}
            />
            <Ouinon place={ouinon2Props.place} yes={ouinon2Props.yes} className={ouinon2Props.className} />
            <input
              className="do-you-have-1 subtitel"
              name="doyouhaveasafetystock"
              placeholder={inputPlaceholder7}
              type={inputType7}
            />
            <Ouinon place={ouinon3Props.place} yes={ouinon3Props.yes} className={ouinon3Props.className} />
            <input
              className="do-you-have-1 subtitel"
              name="doyouhavebufferstocks"
              placeholder={inputPlaceholder8}
              type={inputType8}
            />
            <Ouinon place={ouinon4Props.place} yes={ouinon4Props.yes} className={ouinon4Props.className} />
          </div>
        </div>
        <div className="flex-row-77">
          <Toggle className={toggle4Props.className} buttonSecondaryProps={toggle4Props.buttonSecondaryProps} />
          <Frame11732 />
        </div>
      </div>
    </div>
  );
}

export default LeadTime1;
